import React from 'react'
import { BrowserRouter, Switch, Route } from 'react-router-dom'

import Landing from './pages/landing/landing'

function Routes(){
    return (
        <BrowserRouter>
            <Switch>
                <Route path='/' component={Landing} />
            </Switch>
        </BrowserRouter>
    )
}
export default Routes
